import { Injectable } from '@angular/core';

export interface StockTick {
  date: string;
  close: number;
  high: number;
  low: number;
  open: number;
}

export interface CloseData {
  date: string;
  value: number;
}

@Injectable({ providedIn: 'root' })
export class DataService {
  data = data;
  constructor() {}

  public getData(): StockTick[] {
    return this.data;
  }

  public getClose(): CloseData[] {
    const dataToReturn = [];

    this.data.forEach((element) => {
      dataToReturn.push({ date: element.date, value: element.close });
    });

    return dataToReturn;
  }
}

